import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';

const useStyles = makeStyles((theme) => ({
  table: {
    minWidth: '100%',
    margin: '1em 0',
    background: '#34495E;',
    color:' #fff;',
    borderRadius: '.4em;',
    overflow: 'hidden;'
  },
  tr: {
    borderTop: '1px solid #ddd',
    borderBottom: '1px solid #ddd',
  },
  td: {
    // margin: '.5em 1em;',
    margin: '2rem 1rem 2rem 1rem'

  },
}));

export default function DataTable(props) {
  const classes = useStyles();
  const { data } = props
  return (
    <table className={classes.table}>
      <tr className={classes.tr}>
        <Box className={classes.td}>
          <th>Movie Title</th>
          <th className={classes.td}>Genre</th>
          <th className={classes.td}>Year</th>
          <th className={classes.td}>Gross</th>
        </Box>

      </tr>
      <tr>
        <td className={classes.td}>Star Wars</td>
        <td className={classes.td}>Adventure, Sci-fi</td>
        <td className={classes.td}>1977</td>
        <td className={classes.td}>$460,935,665</td>
      </tr>
      <tr className={classes.tr}>
        <td className={classes.td}>Howard The Duck</td>
        <td className={classes.td}>"Comedy"</td>
        <td className={classes.td}>1986</td>
        <td className={classes.td}>$16,295,774</td>
      </tr>
      <tr className={classes.tr}>
        <td className={classes.td}>American Graffiti</td>
        <td className={classes.td}>Comedy, Drama</td>
        <td className={classes.td}>1973</td>
        <td className={classes.td}>$115,000,000</td>
      </tr>
    </table>
  );
}
